import HomePage from "./pages/HomePage";
import LoginPage from "./pages/LoginPage";

const App = () => {
  return (
    <div>
      <form>
        <input type="text" name="email" id="" placeholder="enter your email" />

        <input type="password" name="password" id="" />
        <input type="submit" />
      </form>
    </div>
  );
};

export default App;
